import styled from "styled-components";

export const StyledCartItem = styled.div`
  display: flex;
  position: relative;
  padding-top: 10px;
  padding-bottom: 5px;
  box-shadow: 0px -3px 4px 0px black;
  margin-bottom: 10px;
`;

export const CartItemImage = styled.img`
  height: 100px;
`;

export const CartItemInfoWrapper = styled.div`
  flex-basis: 100%;
  align-self: center;
`;
